(11, 1, '2023-12-06 07:16:44', '2023-12-06 07:16:44', '<!-- wp:paragraph -->\r\n<p>At Milaya Capital, we are proud to operate successful businesses in three different countries:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>United Kingdom, United Arab Emirates, and Greece. With a commitment to excellence, we run various successful businesses and that cater to various aspects of leting and operating of own or leased real estate, hospitality, Oil &amp; Gas Rigs and Aviation Industry.</p>\r\n<!-- /wp:paragraph -->', 'Our Work', '', 'publish', 'closed', 'closed', '', 'our-work', '', '', '2023-12-06 08:26:45', '2023-12-06 08:26:45', '', 0, 'http://localhost/milayacapital/?post_type=page_section&#038;p=11', 0, 'page_section', '', 0),
(12, 1, '2023-12-06 07:17:05', '2023-12-06 07:17:05', '<!-- wp:paragraph -->\r\n<p>Milaya Capital’s vision is to create a better tomorrow for the generations to come. A world where we can live in a sustainable future; hence we put all our efforts into being environmentally sustainable throughout our company’s operations.</p>\r\n<!-- /wp:paragraph -->', 'What We Do', '', 'publish', 'closed', 'closed', '', 'what-we-do', '', '', '2023-12-06 09:16:35', '2023-12-06 09:16:35', '', 0, 'http://localhost/milayacapital/?post_type=page_section&#038;p=12', 0, 'page_section', '', 0),
(13, 1, '2023-12-06 07:24:24', '2023-12-06 07:24:24', '<!-- wp:paragraph -->\n<p>In the UK and UAE, we specialize in property leQng and the opera:ons of own or leased real estate. Whether you\'re searching for a new place to call home or seeking professional property management services, our team has you covered. We take pride in helping tenants find their dream proper:es and property owners maximize their investments.</p>\n<!-- /wp:paragraph -->', 'Property Letting and Real Estate', '', 'publish', 'closed', 'closed', '', 'property-letting-and-real-estate', '', '', '2023-12-06 07:24:24', '2023-12-06 07:24:24', '', 0, 'http://localhost/milayacapital/?post_type=what_we_do&#038;p=13', 0, 'what_we_do', '', 0),
(14, 1, '2023-12-06 07:24:51', '2023-12-06 07:24:51', '<!-- wp:paragraph -->\n<p>In Dubai and Athens, we have a selection of top-notch restaurants that offer culinary delights from around the world. Our experienced chefs and attentive staff ensure that every dining experience is a memorable one. Whether you\'re looking for fine dining or a casual meal with friends and family, we have the perfect venues. Savor the flavors of the Mediterranean and international cuisine at our restaurants. Our talented chefs use only the freshest, locally sourced ingredients to create a culinary master.</p>\n<!-- /wp:paragraph -->', 'Restaurant &amp; Dining', '', 'publish', 'closed', 'closed', '', 'restaurant-dining', '', '', '2023-12-06 07:24:51', '2023-12-06 07:24:51', '', 0, 'http://localhost/milayacapital/?post_type=what_we_do&#038;p=14', 0, 'what_we_do', '', 0),
(15, 1, '2023-12-06 07:25:10', '2023-12-06 07:25:10', '<!-- wp:paragraph -->\r\n<p>Our successful businesses in the UK provide our customers with quality and quintessential. British style and global exploration service with a wide range of satisfying services to different tastes and preferences, with its 25 locations all in Central London. From trendy fashion barber shops to specialty coffee shops, we provide our customers with high-quality products and a memorable experience. Our coffee shops are cozy havens where you can enjoy exceptional coffee and breakfast in town in a warm ambiance. From your morning caffeine fix to afternoon meetings or relaxation, our coffee shops are your go-to destination in London.</p>\r\n<!-- /wp:paragraph -->', 'Retail', '', 'publish', 'closed', 'closed', '', 'retail', '', '', '2023-12-06 08:37:21', '2023-12-06 08:37:21', '', 0, 'http://localhost/milayacapital/?post_type=what_we_do&#038;p=15', 0, 'what_we_do', '', 0),
(16, 1, '2023-12-06 07:26:06', '2023-12-06 07:26:06', '<!-- wp:paragraph -->\r\n<p>We are at the highest levels by developing it with the best options. We serve with many experienced employees in this field.</p>\r\n<!-- /wp:paragraph -->', 'New Business Heights', '', 'publish', 'closed', 'closed', '', 'new-business-heights', '', '', '2023-12-06 09:20:04', '2023-12-06 09:20:04', '', 0, 'http://localhost/milayacapital/?post_type=page_section&#038;p=16', 0, 'page_section', '', 0),
(17, 1, '2023-12-06 07:26:36', '2023-12-06 07:26:36', '<!-- wp:paragraph -->\r\n<p>We keep you in interaction with many international corporate companies. In this way, communication opportunities increase and we enable access to more portfolios.</p>\r\n<!-- /wp:paragraph -->', 'Why Choose - Connecting businesses, ideas, and people for greater impact.', '', 'publish', 'closed', 'closed', '', 'connecting-businesses-ideas-and-people-for-greater-impact', '', '', '2023-12-06 09:31:14', '2023-12-06 09:31:14', '', 0, 'http://localhost/milayacapital/?post_type=page_section&#038;p=17', 0, 'page_section', '', 0),
