(78, 1, '2023-12-07 04:26:14', '2023-12-07 04:26:14', 'Mileo is situated in the heart of famous Kalo Livadi Beach and at a distance of 10 km from the vibrant Town Centre Mykonos.\r\n\r\nIt is set over the Kalo Livadi beach, with unobstructed views towards the Aegean Sea.\r\n\r\nFamed for its picturesque Cycladic architecture and its cosmopolitan life, Mykonos and especially Kalo Livadi beach will be your favorite summer destination.', 'MILEO LUXURY HOTEL', '', 'publish', 'closed', 'closed', '', 'mileo-luxury-hotel', '', '', '2023-12-07 06:41:21', '2023-12-07 06:41:21', '', 0, 'http://localhost/milayacapital/?post_type=portfolios&#038;p=78', 0, 'portfolios', '', 0),
(79, 1, '2023-12-07 04:27:19', '2023-12-07 04:27:19', 'Our aim at DB.one is to create the ultimate meat experience. We use superior quality Australian Wagyu and US Prime meat sourced from exclusive farms that seek to promote sustainability. The combination of full flavour, marbling and melt in the mouth texture provides an unmatched taste sensation and our meats are at the heart of the plates crafted by our chefs.', 'DBONE RESTAURANT', '', 'publish', 'closed', 'closed', '', 'dbone-restaurant', '', '', '2023-12-07 06:51:35', '2023-12-07 06:51:35', '', 0, 'http://localhost/milayacapital/?post_type=portfolios&#038;p=79', 0, 'portfolios', '', 0),
