(81, 1, '2023-12-07 04:32:51', '2023-12-07 04:32:51', 'The word “coffee” entered the English language in 1582 via the Dutch ‘koffie,’ borrowed from the Turkish ‘kahve.’ Europe started its great love affair with coffee when Ozdemir of Pasha set sail across the Black Sea with a hold full of coffee seeds. Before long, the love for coffee had spread from the Sultans and their Queens to every corner of Turkish society and beyond.', 'THE BLACK PENNY', '', 'publish', 'closed', 'closed', '', 'the-black-penny', '', '', '2023-12-07 06:55:03', '2023-12-07 06:55:03', '', 0, 'http://localhost/milayacapital/?post_type=portfolios&#038;p=81', 0, 'portfolios', '', 0),
